const ApplicationForm = () => {
  return (
    <Wrapper>

        <Grid container item direction="column" xs={12} md={6}>
          <Grid item xs={12} md={6}>
            <h2>Ad eos saepe lucilius, noster postulant philosophia ea usu, qui dicta sadipscing te.</h2>
          </Grid>
          <Grid item xs={6} md={3}>
            <BusinessIcon />
            <p>Et has minim elitr intellegat. Mea aeterno eleifend antiopam ad, nam no suscipit quaerendum.</p>
          </Grid>
          </Grid>
            <Grid item xs={12} md={6}>
              <h2>FORTUNE <br/> 500</h2>
            </Grid>

    </Wrapper>
  )
};

export default ApplicationForm;
